import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { login } from '../services/authService';

const AdminLogin = () => {
  const [form, setForm] = useState({ email: '', password: '' });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleChange = e => setForm({ ...form, [e.target.name]: e.target.value });

  const handleSubmit = async e => {
    e.preventDefault();
    setLoading(true);
    setError('');

    try {
      const response = await login(form);

      // Check if user is admin
      if (response.user && response.user.role === 'admin') {
        localStorage.setItem('token', response.token);
        navigate('/admin');
      } else {
        setError('Access denied. Admin credentials required.');
      }
    } catch (err) {
      setError(err.response?.data?.message || 'Login failed');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="min-vh-100 d-flex align-items-center justify-content-center" style={{
      backgroundColor: '#5a5a5a',
      backgroundImage: 'linear-gradient(135deg, #5a5a5a 0%, #4a4a4a 100%)'
    }}>
      {/* Back to Site Link */}
      <Link
        to="/"
        className="position-absolute text-white text-decoration-none"
        style={{
          top: '20px',
          left: '20px',
          fontSize: '14px',
          opacity: '0.9'
        }}
      >
        ← Back to Site
      </Link>

      <div className="container">
        <div className="row justify-content-center">
          <div className="col-md-4 col-lg-3">
            <div className="card shadow-lg border-0" style={{
              borderRadius: '12px',
              backgroundColor: '#ffffff'
            }}>
              <div className="card-body p-4">
                {/* Header */}
                <div className="text-center mb-4">
                  <h2 className="h4 fw-bold text-dark mb-0" style={{
                    fontSize: '24px',
                    color: '#333'
                  }}>Admin Login</h2>
                </div>

                {/* Error Alert */}
                {error && (
                  <div className="alert alert-danger mb-3" role="alert" style={{ fontSize: '14px' }}>
                    <i className="fas fa-exclamation-triangle me-2"></i>
                    {error}
                  </div>
                )}

                {/* Login Form */}
                <form onSubmit={handleSubmit}>
                  <div className="mb-3">
                    <input
                      type="email"
                      className="form-control"
                      name="email"
                      value={form.email}
                      onChange={handleChange}
                      placeholder="Username"
                      required
                      disabled={loading}
                      style={{
                        borderRadius: '6px',
                        border: '1px solid #e0e0e0',
                        padding: '14px 16px',
                        fontSize: '14px',
                        backgroundColor: '#f8f9fa',
                        color: '#333'
                      }}
                    />
                  </div>

                  <div className="mb-4">
                    <input
                      type="password"
                      className="form-control"
                      name="password"
                      value={form.password}
                      onChange={handleChange}
                      placeholder="Password"
                      required
                      disabled={loading}
                      style={{
                        borderRadius: '6px',
                        border: '1px solid #e0e0e0',
                        padding: '14px 16px',
                        fontSize: '14px',
                        backgroundColor: '#f8f9fa',
                        color: '#333'
                      }}
                    />
                  </div>

                  <button
                    type="submit"
                    className="btn w-100"
                    disabled={loading}
                    style={{
                      backgroundColor: '#34495e',
                      border: 'none',
                      borderRadius: '6px',
                      color: 'white',
                      fontWeight: '500',
                      padding: '14px',
                      fontSize: '16px',
                      transition: 'all 0.3s ease'
                    }}
                    onMouseEnter={(e) => e.target.style.backgroundColor = '#2c3e50'}
                    onMouseLeave={(e) => e.target.style.backgroundColor = '#34495e'}
                  >
                    {loading ? (
                      <>
                        <span className="spinner-border spinner-border-sm me-2" role="status"></span>
                        Logging in...
                      </>
                    ) : 'Login'}
                  </button>
                </form>

                {/* Demo Credentials Info */}
                <div className="mt-4 p-3" style={{
                  backgroundColor: '#f8f9fa',
                  borderRadius: '6px',
                  fontSize: '12px',
                  color: '#666'
                }}>
                  <div className="text-center">
                    <strong>Demo Credentials:</strong><br />
                    <code>admin@enjoydrive.com</code><br />
                    <code>admin123</code>
                    <br />
                    <button
                      type="button"
                      className="btn btn-sm btn-outline-secondary mt-2"
                      onClick={() => setForm({ email: 'admin@enjoydrive.com', password: 'admin123' })}
                      style={{ fontSize: '11px' }}
                    >
                      Auto-fill
                    </button>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminLogin;
